import React from 'react';
import './Contact.css';

function Contact() {
  return (
    <section id="contact" className="contact-section">
      <h2 className="contact-heading">Contact Me</h2>
      <p className="contact-text">I'm always open to discuss new projects or opportunities. Feel free to reach out to me via email!</p>
      <a href="mailto:simarscheema@gmail.com" className="contact-email">simarscheema@gmail.com</a>
    </section>
  );
}

export default Contact;
